Le Kin " + $node["entree"].json.kin + " n'est pas actif ou n'existe pas.

[EXCEPTION - Kin Non-Actif]";

return {"json": {"promptProducteur": output}};

let json = $node["entree"].json;

if ($json.output != null) {
  json.output = $json.output;
} else {
  json.output = "[EXCEPTION - Error with OpenAI call]\n\n" + $prevNode.name +" returned an error when calling OpenAI Assistant\n\n[/EXCEPTION - Error with OpenAI call]"; 
}

json.dernierProducteur = $prevNode.name;
json.promptProducteur = $node["Prompt Producteur"].json.promptProducteur;

json.entireThread += '\n\n---\n\n' + json.output;
json.thread += '\n\n---\n\n' + json.output;

return {"json": json};

let json = $node["input"].json;

// Cleaner les datas utilisées
delete json.output;
delete json.dernierProducteur;
delete json.promptProducteur;
json.remainingThread = "";

// Préparer le nouveau thread
json.entireThread = $node["thread"].json.thread;
json.thread = $node["thread"].json.thread;

// Préparer les nouvelles instructions
json.instructions = json.query?json.query:json.instructions; // Cas fonction GPT

MAX_LENGTH = 10000;
if (json.thread.length > MAX_LENGTH) {
    json.thread = "Le début du document est déjà rédigé, voici le thread[...]\n\n" + json.thread.substring(json.thread.length - MAX_LENGTH);
    json.remainingThread = json.entireThread.substring(0, json.entireThread.length - MAX_LENGTH);
}

if (!json.documentGoogleDriveId) {
  json.documentGoogleDriveId = $node["thread"].json.documentGoogleDriveId;
}

json.date = $now.toString();
json.executionId = $execution.id;

return {"json": json};
